class Esod::OutgoingLetter < ActiveRecord::Base
  has_many :esod_outgoing_letters_matters, class_name: 'Esod::OutgoingLettersMatter', foreign_key: :esod_outgoing_letter_id 
  has_many :esod_matters, through: :esod_outgoing_letters_matters

  has_many :esod_outgoing_letters_documents, class_name: 'Esod::OutgoingLettersDocument', foreign_key: :esod_outgoing_letter_id 
  has_many :documents, through: :esod_outgoing_letters_documents

  has_many :works, as: :trackable, source_type: 'Esod::OutgoingLetter'

  accepts_nested_attributes_for :esod_outgoing_letters_documents, reject_if: :all_blank, allow_destroy: true

  def fullname
    "#{self.esod_outgoing_letters_matters.last.sygnatura}"
    # "#{znak}, [#{iks_name}] (#{id})"
  end

  def fullname_and_id
    "#{self.esod_outgoing_letters_matters.last.sygnatura} (#{id})"
    # "#{znak}, [#{iks_name}] (#{id})"
  end

  def attached_file_name
    attached_file = Document.find(document_id) if document_id.present?
    if attached_file.present?
      "#{attached_file.fileattach_filename}"
    else
      "pismo_przewodnie.pdf"
    end
  end

  def attached_file
    attached_file = Document.find(document_id) if document_id.present?
    if attached_file.present?
       Base64.strict_encode64(attached_file.fileattach.read)
    else
      ""
    end
  end

  def attached_file_esod_category
    attached_file = Document.find(document_id) if document_id.present?
    if attached_file.present?
      Esodes::esod_attached_file_category(attached_file.fileattach_content_type)
    else
      2
    end
  end

  def zalaczniki
    zalaczniki_array = []

    self.documents.each do |row|

      zalaczniki_array <<  {
                              # "idKategorii" => "#{Esodes::esod_attached_file_category(row.fileattach_content_type)}",
                              "idKategorii" => 4,
                              "nazwa" => "#{row.fileattach_filename}",
                              "tresc" => Base64.strict_encode64(row.fileattach.read)
                            }

    end

    return zalaczniki_array
  end

  def push_soap_and_save(matter)
    my_token = Esodes::EsodTokenData.token_string
    if Esodes::EsodTokenData.response_token_errors.present? 
      Esodes::EsodTokenData.response_token_errors.each do |err|
        errors.add(:base, "#{err}")
      end
      return false
    end

    client = Savon.client(
      encoding: "UTF-8",
      wsdl: "#{Rails.application.secrets[:wso2ei_url]}/services/DokumentWychodzacyESODUsluga?wsdl",
      endpoint: "#{Rails.application.secrets[:wso2ei_url]}/services/DokumentWychodzacyESODUsluga.DokumentWychodzacyESODUslugaHttpsSoap11Endpoint",
      namespaces: { "xmlns:soapenv" => "http://schemas.xmlsoap.org/soap/envelope/",
                    "xmlns:dok" => "http://dokumentwychodzacyESOD.dokument.uslugi.epl.uke.gov.pl/" 
                  },
      namespace_identifier: :dok,  
      strip_namespaces: true,
      logger: Rails.logger,
      log_level: :debug, # [:debug, :info, :warn, :error, :fatal]
      log: true,
      pretty_print_xml: true,
      env_namespace: :soapenv,
      soap_version: 1,
      wsse_timestamp: true,
      ssl_verify_mode: :none,
      headers: { "Authorization" => "Basic #{Esodes::base64_user_and_pass}" },
      wsse_auth: [Esodes::EsodTokenData.netpar_user.email, my_token],
      soap_header: { "dok:metaParametry" => 
                      { "dok:identyfikatorStanowiska" => Esodes::EsodTokenData.token_stanowiska.first[:nrid] } 
                    }
    )

    message_body = { 
      "parametryOperacjiUtworzDokumentWychodzacy" => {
        "dataPisma" => "#{self.data_pisma}",
        "identyfikatorRodzajuDokumentu" => "#{self.identyfikator_rodzaju_dokumentu_wychodzacego}",
        "identyfikatorSprawy" => "#{matter.nrid}", 
        "opis" => "#{self.tytul}", 
        "tresc" => "#{self.uwagi}", 
        "zaakceptujDokument" => false,
        "zakonczSprawe" => false,
        "odwzorowanie" => {
          "idKategorii" => "#{self.attached_file_esod_category}",
          "nazwa" => "#{self.attached_file_name}",
          "tresc" => "#{self.attached_file}"
        },
        "wysylka" => {
          "czyAdresGlowny" => true,
          "identyfikatorAdresu" => "#{self.identyfikator_adresu}",
          "identyfikatorSposobuWysylki" => "#{self.identyfikator_sposobu_wysylki}"
        },
        "zalacznik" => JSON.parse(self.zalaczniki.to_json)
      }
    }

    response = client.call(:utworz_dokument_wychodzacy,  message: message_body )

    if response.success?
      response.xpath("//*[local-name()='return']").each do |ret|
        response.xpath("//*[local-name()='dokumentWychodzacy']").each do |row|
          self.numer_ewidencyjny = row.xpath("./*[local-name()='numerEwidencyjny']").text
          self.nrid = row.xpath("./*[local-name()='nrid']").text 
          self.save

          self.esod_outgoing_letters_matters.create(
            esod_matter_id: matter.id,  
            sprawa: matter.nrid,   
            dokument: self.nrid,   
            sygnatura: row.xpath("./*[local-name()='sygnatura']").text,
            initialized_from_esod: false,
            netpar_user: self.netpar_user)
          true
        end
      end
    else
      false
    end

    rescue Savon::HTTPError => error
      Esodes::log_soap_error( error,
                              file:      '\models\esod\outgoing_letter.rb', 
                              function:  "push_soap_and_save(matter)", 
                              soap_function:  "utworz_dokument_wychodzacy", 
                              base_obj:   self )

      false


    rescue Savon::SOAPFault => error
      Esodes::log_soap_error( error,
                              file:      '\models\esod\outgoing_letter.rb', 
                              function:  "push_soap_and_save(matter)", 
                              soap_function:  "utworz_dokument_wychodzacy", 
                              base_obj:   self )

      false

    rescue Savon::InvalidResponseError => error
      Esodes::log_soap_error( error,
                              file:      '\models\esod\outgoing_letter.rb', 
                              function:  "push_soap_and_save(matter)", 
                              soap_function:  "utworz_dokument_wychodzacy", 
                              base_obj:   self )

      false


    rescue Savon::Error => error
      Esodes::log_soap_error( error,
                              file:      '\models\esod\outgoing_letter.rb', 
                              function:  "push_soap_and_save(matter)", 
                              soap_function:  "utworz_dokument_wychodzacy", 
                              base_obj:   self )

      false

    rescue SocketError => error
      Esodes::log_soap_error( error,
                              file:      '\models\esod\outgoing_letter.rb', 
                              function:  "push_soap_and_save(matter)", 
                              soap_function:  "utworz_dokument_wychodzacy", 
                              base_obj:   self )

      false

    rescue => error
      Esodes::log_soap_error( error,
                              file:      '\models\esod\outgoing_letter.rb', 
                              function:  "push_soap_and_save(matter)", 
                              soap_function:  "utworz_dokument_wychodzacy", 
                              base_obj:   self )

      false
  end


end

